import React from "react";
import {LiWrapper} from "./webcomps";
import PropTypes from "prop-types";
import styled from 'styled-components';

import SectionTitle from "./sectionTitle";
const StyleText = styled.span`
    color: ${props => props.hexCode};
`;
const TaskList = (props) => {
  console.log(taskList.title, '<><><><>');
  const { listHeader, taskList } = props;
  itemList = taskList.title.splice(taskList.hightLight);
  if (itemList.length === 1) {
    itemList.push('');
  }
  return(
    <div>
        <SectionTitle title={listHeader}/>
        <ul>
          <LiWrapper>
              <span>{itemList[0]}}</span>
          </LiWrapper>
          <LiWrapper>
              <StyleText>{itemList[1]}</StyleText>
          </LiWrapper>
          <LiWrapper>
              <span>{itemList[2]}</span>
          </LiWrapper>
        </ul>
    </div>
  );
};

TaskList.propTypes = {
    listHeader: PropTypes.string.isRequired,
    taskList: PropTypes.object.isRequired,
};

export default TaskList;
